sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...

  if(inputs.status_code_role==200)
  {
    var responseBodyRole = JSON.parse(inputs.response_body_roleid);
    var a = "";
    //var IDR;
    var list = (responseBodyRole.Resources).length;
    for(var i=0;i<list;i++)
    {
      a += responseBodyRole.Resources[i].id;
      //IDR= roleid1.id;
      //a.push(IDR);
    }
    //a=JSON.stringify(a);

    outputs.roleid = a;


  }
  if(inputs.status_code_user==200){
 var responseBodyUser = JSON.parse(inputs.response_body_userid);
    var b = "";
    var IDU;
    var listU = (responseBodyUser.Resources).length;
    for(var i=0;i<listU;i++)
    {
    b += responseBodyUser.Resources[i].id;

    }
    //b=JSON.stringify(b);
    outputs.userid = b;
  }


})(inputs, outputs);

